  `desc` varchar(100) default NULL COMMENT '说明',
  `server_id` int(11) default NULL COMMENT '服务器',
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='机柜位置';

/*Data for the table `cabinet_position` */

