/*Table structure for table `document` */

DROP TABLE IF EXISTS `document`;

CREATE TABLE `document` (
  `id` int(11) NOT NULL auto_increment,
  `doc_id` varchar(64) default NULL COMMENT '文档id，用于多版本时标识文档的唯一标识',
