DROP TABLE IF EXISTS `server_software`;

CREATE TABLE `server_software` (
  `id` int(11) NOT NULL auto_increment,
  `server_id` int(11) NOT NULL,
  `software_id` int(11) NOT NULL,
  `install_date` datetime NOT NULL,
